      <div className="ratio-wrapper">
        <Window className="image-window" />
      </div> */}
            <div className="window-wrapper">
              <div className="window"><img
                    className="image"
                    src={process.env.PUBLIC_URL + img_dir}
                    alt="not found"
                /></div>

            </div>
            <div className="window-wrapper">
              <div className="window"><img
                    className="image"
                    src={process.env.PUBLIC_URL + img_dir}
                    alt="not found"
                /></div>
            </div>
        </div>
    );
};

export default ImageSection;
